import unittest
import dclnt


class TestFileMethods(unittest.TestCase):


    def test_flat(self):
        actual = dclnt.flat([(1, 2), (3, 4)])
        expected = [1, 2, 3, 4]
        self.assertEqual(actual, expected)

    def test_is_verb(self):
        self.assertTrue(dclnt.is_verb("run"))
        self.assertFalse(dclnt.is_verb("wall"))

